import React from 'react';
import Logo from '../images/logo.svg';

function Header() {
    return (
        <header>
            <nav className="navbar">
                <img src={Logo} alt="logo"/>
            </nav>
            <div className="heading-background"></div>
        </header>
    )
}

export default Header;
